template <typename S, typename D, bool wls>
void ns(const program& prg)
{
    csv<','> c("../input/epi.csv");
    D dr;

    uncertain x0;
    if(prg.estimatex0)
    {
        if(prg.offset > 0)
        {
            seirdata d = dr.read(c,0);
            vector<double> ip;
            for(unsigned i=0; i<prg.params.size(); i++)
                ip.push_back(prg.params[i].initial);
            hestseir<S,wls> is;
            seirfilter::G ir = is.eval(ip,d, prg.eep);
            x0 = ir.est[prg.offset];
        }
    }
    else
    {
        dvector x = dv(prg.x0);
        unsigned k=x.size();
        dmatrix v(k,k);
        unsigned s=0;
        for(unsigned i=0; i<k; i++)
            for(unsigned j=0; j<k; j++)
                v(i,j) = prg.v0[s++];
        x0 = { x,v};
    }
    seirdata d = dr.read(c,prg.offset);

    hestseir<S,wls> es(x0);

    vector<double> rp;
    if(prg.estimate)
    {
        uncertain res;
        clog << "contrast= " << es.estimate(prg.params,d,prg.eep, res,prg.timest) << endl;

        rp = vd(res.x());
        clog << "{";
        for(unsigned i=0; i<prg.params.size(); i++)
        {
            clog << "{\"" << prg.params[i].name << "\","
                << rp[i] << "," << prg.params[i].lower << "," << prg.params[i].upper << ","
                << (prg.params[i].omit ? "true" : "false") << "},";
            clog << "// (" << sqrt(res.var()(i,i)) << ") "
                    << endl;
        }
        clog << "}," << endl;
    }
    else // prg.estimate
    {
        for(unsigned i=0; i<prg.params.size(); i++)
            rp.push_back(prg.params[i].initial);
    }

    if(prg.output)
    {
        auto ep = prg.oep;
        seirfilter::G r = es.eval(rp,d, ep);
        ofstream o("output.csv");
        r.output(o,true);

        if(prg.outputx0)
        {
            auto x0 = es.X0(rp);
            clog << "{" << m2csv(x0.x().transpose()) << "}," << endl;
            const auto& v = x0.var();
            clog << "{" << endl;
            for(unsigned i=0; i<v.rows(); i++)
                for(unsigned j=0; j<v.cols(); j++)
            {
                clog << v(i,j) << ",";
            }
            clog << "}," << endl;
        }
        clog << "// contrast = " << r.contrast << endl;
        clog << "// susceptible  " << es.abssusceptible(r.y.size()-1,rp,r) << endl;
    }
};



int nw()
{
    double startt = time(0);

    try
    {
        ns<hfourseir,fourdatareader,true>(g4);
//      ns<hsingleseir,singledatareader,true>(g);
    }
    catch (std::exception& e) {
        std::cerr << e.what() << endl;
        return 1;
    }
    catch (const char* m)
    {
           cerr << m << endl;
           return 1;
    }
    catch (const string& m)
    {
           cerr << m << endl;
           return 1;
    }
    catch(...)
    {
        cerr << "unknown exception" << endl;
        return 1;
    }


    clog << "time: " << time(0)-startt << " seconds." << endl;

    return 0;
}
